public class InnerRetrieverRetrieverConfigurationFactory(Action<Humidifier.QBusiness.RetrieverTypes.RetrieverConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.QBusiness.RetrieverTypes.RetrieverConfiguration>
{

    internal InnerRetrieverKendraIndexConfigurationFactory KendraIndexConfigurationFactory { get; set; }

    internal InnerRetrieverNativeIndexConfigurationFactory NativeIndexConfigurationFactory { get; set; }

    protected override Humidifier.QBusiness.RetrieverTypes.RetrieverConfiguration Create()
    {
        var retrieverConfigurationResult = CreateRetrieverConfiguration();
        factoryAction?.Invoke(retrieverConfigurationResult);

        return retrieverConfigurationResult;
    }

    private Humidifier.QBusiness.RetrieverTypes.RetrieverConfiguration CreateRetrieverConfiguration()
    {
        var retrieverConfigurationResult = new Humidifier.QBusiness.RetrieverTypes.RetrieverConfiguration();

        return retrieverConfigurationResult;
    }
    public override void CreateChildren(Humidifier.QBusiness.RetrieverTypes.RetrieverConfiguration result)
    {
        base.CreateChildren(result);

        result.KendraIndexConfiguration ??= KendraIndexConfigurationFactory?.Build();
        result.NativeIndexConfiguration ??= NativeIndexConfigurationFactory?.Build();
    }

} // End Of Class

